import logo from '../images/logo.gif';
import '../styles/App.css';
import {Button} from '@material-ui/core';

const styleClaim = {
  backgroundColor: '#E54286',
  color: '#12173D',
  fontSize: 'calc(12px + 2vmin)',
  fontFamily: 'm5x7',
  boxShadow: 'none',
  borderRadius: '0px',

  '&:hover': {
      backgroundColor: '#78FAE6',
      color: '#ffffff',
      boxShadow: 'none',
  }
};

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="DystoPunks V2" />
        <p style={{lineHeight: "calc(12px + 2vmin)"}}>
        <b style={{color: '#ffff02'}}>SuperNovas</b> are a group of 10.000 intergalatic girls with outstanding <br/> style and out of these world vibes, creating a fun and diverse universe <br/> in the midst of the nft world.<br/><br/>   
        <Button style={styleClaim} variant="contained" size="small" href="https://opensea.io/collection/dystopunks" target="_blank" rel="noopener noreferrer"><b>Buy at OpenSea</b></Button>    
        <br/></p>
      </header>  
    </div>
  );
}

export default App;
